INSERT INTO `sys_log` VALUES ('598e5f6aaf714fa1bac1c48c07503f76', '13393444446', '新增旅游产品信息表数据', 'com.bettem.modules.tourism.controller.TourismProductInfoController.save()', '{\"childrenPrice\":399,\"createUserId\":\"09f03c8b72d743f0978888cb2aa0b034\",\"supplierId\":\"09f03c8b72d743f0978888cb2aa0b034\",\"singleRoomPrice\":150,\"endDate\":1619107200000,\"adultPrice\":599,\"productCharacteristic\":\"<p>西安落地成团《最长安》，连续12年陕西销量冠军产品，十万人口碑验证</p><p>【品质 Quality】甄选准四星品质住宿，连住四晚不挪窝   【经典 Classic】最硬扎 5A 景区：秦始皇兵马俑、最完整古代城垣-西安明城墙（指定游览永宁门）   【串接 Tandem】地道四景联游：回民街/曲江寒窑/大雁塔喷泉广场/不夜城、美食/民俗/民居/夜景交织于此   【感受 Reception】馆藏、古迹、园林融为一体，走进西安博物院，远眺小雁塔、看华夏三千年岁月变迁   【体验 Experience】打卡白鹿原影视城，【民国服装秀】+【华阴老腔】+【二虎守长安】，赠三大趣味交互体验  【美食 Gourmet】老陕油泼面、大秦福宴、大唐烧尾宴三大地道特色美食，饕餮享受，唇齿留香   【礼遇 Courtesy1】赠价值 280 元/人《西安千古情》，无线讲解耳麦赠送使用。   【礼遇 Courtesy2】赠送价值158元/人《雁塔故事》演出，走进西安历史，感受繁荣变迁   【纯净 Pure】全程 0 自费，高性价比纯净之旅</p>\",\"travelInfo\":\"<p>D1\\t出发地—西安                                                                                                                               交通工具：飞机/高铁/火车    今日行程 1，出发地出发抵达西安； 2，出站后由我社工作人员接站，乘车前往酒店； 3，报客人名字登记入住，后自由活动。  入住酒店 精选西安舒适型酒店： 餐饮标准： 早餐：自理\\t午餐：自理            晚餐：自理 备注提示 1航班信息以出团通知为准； 2出发地无送站服务，请自行办理登机手续； 3抵达后请保持手机开机并注意接听； 4我社已代定机场至酒店专车接站服务，出站口仅提供临时停靠，需步行至集合点上车； 5导游将于 21:00 前通知次日的集合出发时间（晚班机可能延后通知）; 6此日无行程安排，不包含餐、导游服务； 7到达酒店后请根据时间自行安排活动；任何情况均请拔打 7*24 小时紧急联系人电话。   D2   白鹿原影视城—明城墙—回民街                                                                                                        今日行程 1、早餐后酒店出发，前往蓝田（车程 75 公里，行车时间约 1.5 小时）； 2、游览【白鹿原影视城】（包含门票+单程扶梯+单程观光车，参观时间约 3 小时），体验【民国服装秀】穿越 1912， 观看【华阴老腔】表演以及大型历史实景演出【二虎守长安】（此三项为赠送项目，不参加不退费且不作任何等 价交换和另行安排）； 3、约 12 点于指定用餐点品尝特色---老陕油泼面(赠送餐项，不用不退费且不作任何等价交换和另行安排） 并稍作休息； 4、返回西安，前往【明城墙●永宁门】（门票已含，自行车骑行需自理，游览时间约 1 小时） 5、前往【钟鼓楼广场】、【回民街】（晚餐自理，自由活动约 1.5 小时）游客可自由品尝西安特色美食； 6、乘车返回，入住酒店   景点风采              入住酒店 精选西安舒适型酒店： 餐饮标准：早餐：包含                           午餐：老陕油泼面\\t                   晚餐：自理  备注提示： 1【白鹿原影视城】包含门票+单程观光扶梯+单程观光车（此三项为赠送项目，不参加不做退费）； 2老陕油泼面为赠送餐项，不用不退费且不作任何等价交换和另行安排 3因回民街为少数民族聚集地，游览时请尊重少数民族习俗。自由活动期间，注意人身财产安全。   D3   西安博物院—兵马俑—观赏西安千古情                                                                                                今日行程 1，早餐后酒店出发，前往雁塔区（车程 12 公里，行车时间约 0.5 小时）； 2，游览【西安博物院】（游览时间约 1.5 小时）园内馆、塔、寺交相辉映，相得益彰； 3，乘车前往临潼（行程约 54KM，行车时间约 1 小时）； 4，中午指定餐厅享用特色午餐-大唐烧尾宴（赠送项目，不用不退费且不作任何等价交换和另行安排），并稍作休息； 5，游览世界文化遗产、有着第八大奇迹之称的【秦始皇兵马俑博物馆】（门票已含，参观时间约 2 小时，景区电瓶 车 5 元/人需自理），细数历史风云，领略强秦风采； 6，观赏一生必看的演出【西安千古情】（观赏时间约 1.5 小时，价值￥280 元/人，赠送体验，不用不退 费且不作任何等价交换和另行安排）。 每一台“千古情”都是一个城市的文化传奇，大型歌舞千古情是一生必看的演出。西安千古情是一部由西安世博园集团在浐灞生态区共同打造的大型歌舞，以一位华裔少女回国寻根的故事为主线，开启一次寻找民族记忆之旅 ，用独特的艺术 表现手法，撷取西安这块充满传奇的土地上发生过的文化片段。演出分为《文明之光》《灞河之洲》《大禹治水》《大唐盛世》《丝绸之路》等场。《西安千古情》不是简单地表达历史，而是用独特的艺术表现手法，撷取了西安文化的片段，为观 众奉献出一台喜闻乐见的作品。 这里有灞柳依依间的浪漫诗情，这里有大唐长安的盛世华章，这里有万里扬沙的丝路传奇， 这里有复兴之路的铮铮强音...... 7，晚餐自理后乘车返回，入住酒店  景点风采   入住酒店 精选西安舒适型酒店： 餐饮标准：早餐：包含\\t午餐：大唐烧尾宴\\t晚餐：自理  备注提示 1【西安博物院】每周二闭馆，若逢闭馆，导游可变更其他景点或调换西安博物院参观日程； 2大唐烧尾宴及千古情均为赠送项目，不用不退费且不作任何等价交换和另行安排； 3兵马俑景区内均设立有旅游商品出售（如书籍、蓝田玉等），此类商品店非旅行社协议购物店，您可自由进出，购物请谨慎，出现 质量问题，我社不承担任何责任。    D4   翡翠奇石馆—乳胶生活体验馆—曲江寒窑—-雁塔故事——大雁塔广场—大唐不夜城                                                  今日行程 1、早餐后酒店出发，前往参观翡翠奇石馆（翡翠及工艺品展示与销售，参观时间约 2 小时） 2、中午享用特色午餐-大秦福宴（赠送项目，不用不退费且不作任何等价交换和另行安排），并稍作休息； 3、午餐后前往参观乳胶生活体验馆（主营乳胶、丝绸、石墨烯科技及珠宝玉器，参观时间约 2 小时），； 4、前往游览中国第一个大型婚俗婚礼婚仪体验式主题公园，【寒窑遗址公园】（赠送游览，游览时间约 1 小时）； 5、前往亚洲最大喷泉与水景广场-【大雁塔广场】，中国最美步行街【大唐不夜城】自由活动； 6、观看价值158元/人《雁塔故事》演出，走进西安历史，感受繁荣变迁（赠送体验，不用不退 费且不作任何等价交换和另行安排）。 7、晚餐自理； 8、后自行返回，入住酒店；  景点风采              入住酒店 精选西安舒适型酒店： 餐饮标准：早餐：包含                     午餐：大秦福宴                     晚餐：自理     备注提示 1行程中标注赠送项目，如不参加，我社不予退费且不作任何等价交换和另行安排； 2如若你对此次行程有任何异议，请告诉我们，我们会在第一时间根据你反馈的情况落实调查并及时处理； 3请保持手机畅通，我们的司机会在晚上 21:00 左右和您联系，以确定送您去机场和火车站的时刻，如未及时接到通知，请及时与我们联系。   D5\\t西安—出发地                                                                                                                                 今日行程       1、早餐后酒店出发，前往游览卧龙寺文化旅游街区（游览时间4小时）        2、可以自费游览到世界最大的石制图书库--【碑林博物馆】，中国书法艺术的鼎峰汇聚于此，        3、 游览汉族地区佛教全国重点寺院【卧龙寺】（30分钟）       4、参观文化城（1小时），   温馨提示：乘坐火车的游客建议预定15:30之后的车次； 乘坐高铁的游客建议预定16:00之后的车次； 乘坐飞机的游客建议预定17:30之后的航班。 交通工具：飞机/高铁/火车  今日行程 1、早餐后自由活动，自由活动期间不含车、导游以及用餐服务； 2、地接旅行社根据游客的车次或航班时间，安排提前 2 小时送达车站（机场）； 3、游客乘坐由组团社定购的团队车次（或航班）返回自己温馨的家，结束难忘的西安之旅；  餐饮标准：早餐：包含\\t午餐：自理\\t晚餐：自理  备注提示 1我社已代定酒店至机场专车送站服务，请根据通知时间提前退房； 2酒店提供免费早餐，在酒店开餐前需出发的，酒店提供路餐打包（酒店住宿赠送），请勿忘于前台领取； 3出发时间在中午 12 点后的，请提前退房，再自行安排活动（请注意酒店退房时间，避免不必要的损失，外出前可将行李寄存前      台）； 4我们将提前 3 小时送机，以确保不误机（早班机乘客，敬请理解，不服从旅行社安排，造成误机，旅行社概不 承担损失）； 5登机手续请根据机场指引自行办理。</p>\",\"reservationNotes\":\"<p>■成人价格：享受“包含项目”所有内容。 ■儿童价格：享受“包含项目”中用车，中餐、晚餐（早餐为酒店赠送，按照 1 间房 2 份早餐标准，如儿童超高超 龄产生早餐费用自理）；其它费用自理。 ■航空保险、出发地接送站、行程中注明的自理项目、个人消费（如酒店内消费和自由活动消费）行程中不含的餐。及出 发地自费项目。</p><p>关于旅游购物场所补充协议   应旅游者要求，为使旅游团内旅游者更多了解目的地人文风俗，更好的体验当地文化，现将旅游合同中【旅游行程】 的自由活动时间委托旅行社代为安排，经旅游者与旅行社双方充分协商，就本次旅行社代为安排和推荐的旅游购物以及 自费演出项目等达成一致，旅游者自愿签署本补充协议。 特别说明： 陕西省具有丰富的文化历史和美丽的自然风光，以下推荐的自费项目具有陕西浓厚历史文化底蕴。您可以在自由活 动期间，根据自己的喜好，自愿选择自费项目，相信陕西的自费活动会带给您不同的体验； 一：委托安排购物场所：  行程日期\\t委托安排购物场所\\t活动停留时间\\t项目内容 D4\\t大缅玉器馆\\t约120分钟\\t特产、兵马俑纪念品、玉石等  D4\\t泰 莱 康 睡 眠 体 验 中 心\\t 约120分钟\\t 石墨烯科技用品等     二：景区配套小交通设施：  行程日期\\t景区设施\\t说明 D3\\t兵马俑博物馆电瓶车 5元/人（单程）\\t自愿选择 我已阅读并充分理解补充条款（一、二）所有内容，并愿意在友好、平等、自愿的情况下确认： 旅行社已就此次行程的购物相关、自理项目事宜及相关风险对我进行了全面的告知、提醒。我经慎重考虑后，自愿 前往上述购物场所购买商品，自愿按照自己喜好参加自费和自理项目，旅行社并无强迫。我承诺将按照导游提醒办理相 关事宜，并遵循旅行社的提示理性消费、注意保留购物单据、注意自身人身财产安全。如因自身原因取消或因旅行社不 能控制因素无法安排的，对旅行社予以理解。 我同意《合同补充条款》作为双方签署的旅游合同不可分割的组成部分。  甲方代表（旅游者）：\\t乙方（旅行社）： 有效身份证：\\t签约代表： 有效联系电话：\\t联系电话： 签约日期：\\t签约日期： 免责声明 1\\t如因景区景点或经营方调整节目表演时间、演职人员、表演方按时休息恰好错过游客观赏时间，则本公司不能承担 相应赔偿。 2\\t如遇天气原因、突发事件等不可抗力、不可预见因素导致无法按约定时间或行程游览，行程变更后增加的费用由旅 游者承担，旅行社要积极解决处理，未发生的费用视情况退还旅游者。 3\\t行程中的出发时间、景点游览时间仅供参考，如因人力不可抗因素导致车程时间延长，请游客谅解并配合。 4\\t行程中有任何问题请致电本社质监员处理或组团社（游客报名处），由于游客主动与旅游地区的司机、导游、其他游 客、当地市民、百姓等人群发生纠纷和肢体冲突造成的一切后果自行承担。 质量监督 1）投诉告之义务：由于旅游产品服务为生产与消费同时进行的无形产品，自身涉及多环节、综合复杂多样性的特点； 请游客在旅游过程中对接待社所提供的服务有不满意之处需要投诉：特别是导游司机的服务；请第一时间拨打质量 监督投诉电话，将不满意的地方告诉我们、以便我社在第一时间现场核实情况并及为您解决！所有问题在当地积极 协调解决处理为妥！否则视为满意。（因旅游服务是无形产品；返程后再调查取证困难） 2）填写意见书义务：请游客本着公平、公正、实事求是的原则认真、如实填写〈游客意见书〉。当地解决不了的投诉， 我公司将根据〈游客意见书〉的信息对接待质量进行核查裁定，解决投诉以游客和此团其他大部分游客在当地所签 署的〈游客意见书〉为依据，恕不受理因游客虚填或不填而产生的服务质量后续争议以及与意见单不符合的投诉。 3）感谢您对我社的支持和信任，为能给您提供更称心的旅程，我社要求导游不得擅自增加行程之外的自费项目/购物点、 如遇相关情况，请与我社质量监督联系，我社旅将立即跟踪处理。</p>\",\"productName\":\"西安落地成团《最长安》连续12年销售冠军产品    超过十万人的选择\",\"returnRules\":\"<p>本产品为目的地成团。根据发团需要，本产品有可能在部分行程段导游及团友的变化，请您谅解。具体拼团次数及行  程段视线路收客情况而定。</p><p>为确保您的出行需求，请您于产品购买成功后12小时内联系客服进行出团前二次确认。</p><p></p>\",\"lineType\":\"2\",\"contactNumber\":\"13546648118\",\"tripDays\":5,\"id\":\"2c8b6f3fe38049d6a4c33f0a6972c48f\",\"state\":\"0\",\"createDate\":1618199477032,\"deleteState\":\"0\",\"supplierName\":\"盈科旅游晋中分公司\",\"costExcluded\":\"<p></p>\",\"tripNightNum\":4,\"picList\":[{\"createUserId\":\"09f03c8b72d743f0978888cb2aa0b034\",\"productId\":\"2c8b6f3fe38049d6a4c33f0a6972c48f\",\"sortNum\":1,\"id\":\"0092a7d404204729b9cd79ea4160f07d\",\"thumbUrl\":\"data:image/png;base64,\",\"createDate\":1618199477032,\"deleteState\":\"0\"},{\"createUserId\":\"09f03c8b72d743f0978888cb2aa0b034\",\"productId\":\"2c8b6f3fe38049d6a4c33f0a6972c48f\",\"sortNum\":2,\"id\":\"159308105ffb43d497cbb4710b65be68\",\"thumbUrl\":\"/platform/2021/4/12/957542dc2366445e8b0a73cb306796b0.jpg\",\"createDate\":1618199477032,\"deleteState\":\"0\"},{\"createUserId\":\"09f03c8b72d743f0978888cb2aa0b034\",\"productId\":\"2c8b6f3fe38049d6a4c33f0a6972c48f\",\"sortNum\":3,\"id\":\"4fba9f0ccbdf49ddb804afb7d3632ced\",\"thumbUrl\":\"/platform/2021/4/12/045e998f54d145a9ad423314578ae246.jpg\",\"createDate\":1618199477032,\"deleteState\":\"0\"},{\"createUserId\":\"09f03c8b72d743f0978888cb2aa0b034\",\"productId\":\"2c8b6f3fe38049d6a4c33f0a6972c48f\",\"sortNum\":4,\"id\":\"3b08fe4e0b3a4cbbac35ff5d675b53b7\",\"thumbUrl\":\"/platform/2021/4/12/d52a8d17a4944881a26d4d72fae7d7c4.jpg\",\"createDate\":1618199477032,\"deleteState\":\"0\"}],\"startingCity\":\"晋中市\",\"costInclusion\":\"<p>[区间交通] 包含 行程内标明用车（旅游巴士） ■行程内用车为旅游巴士，根据同团人数安排车型，一人一座，不提供座次要求； ■因延线有行车公里数限制及部分路段维修，易发生堵车，发车时间均较早，行程内标注出发及行车时间均为预计，具体情况可能略有不同；行程内所有自由活动期间及行程外均不含用车。请予以理解。       [住宿包含] \\t   住宿 包含行程所列4晚当地四星酒店，每人1床位 ■酒店不提供三人间及加床，2人以下单床位的，须补房差。 ■因旅游者主观要求标准不同，酒店未达到个人住宿要求标准的不属于旅游行程质量范畴。遇特殊原因（如天气，交通， 地面， 酒店接待能力），可能变更住宿地点，标准不变。 [餐饮包含] \\t 用餐 包含 4早餐3正餐 ■如每桌人数不足10人，则餐费不变的情况下，酌情增减菜品数量，参考菜单中个别菜品可能随时令有所调整。（中式 餐或自助餐或特色餐，自由活动期间用餐请自理；如因自身原因放弃用餐，则餐费不退）。 ■大西北用餐口味以及餐质可能和其他地区不同，不习惯者请提前自备佐食，因整体餐费不以个人用餐与否减少，自愿放 弃用餐无费用可退，敬请谅解。用餐后的休息时间属自由活动时间    [景点包含] \\t      ■全程只含首道门票（此产品已经扣除所有优免门票差价，故所有游客均不再重复享受门票优免政策） 备注：景区配套交通设施需自理（明细见行程内温馨提示） [导游包含] 导游 包含 行程内含优秀持证国语导游讲解服务 ■行程内导游仅负责旅游者的日常组织安排，延途讲解，问题处理； ■行程内导游会以同团大部分旅游者作为照顾对象，如需按照自已意愿游览，或不按规定时间安排的，为避免同团其它旅 游者造成不满，我社不作任何特殊安排。 [其它项目] 赠送：《西安千古情》演出和《雁塔故事》 赠送：老陕油泼面、大秦福宴、大唐烧尾宴 1、赠送项目如遇特殊原因（如天气，路况，时间等）未抵达，或变更均为社根据实际情况的合理安排，不退费，亦不等价折换其它；此赠送仅包含成人。 2、所有特色餐，若因客人自身原因放弃，不退费且不作任何等价交换或另行安排。  保险：旅行社责任险 如因交通事故造成游客人身伤害及财产损失，按照《中华人民共和国道路交通事故处理办法》进行赔偿，解释权及理赔权由保险公司负责（注：保险公司对3岁以下和75岁以上老年人不受理，另身体有疾病的，请不要参加旅行团。老人、小孩建议有家人陪同，在景区游览时要结伴而行）。  【取消变更】 1、客人中途不能离团，请组团社与客人签好相关协议。如果客人取消行程或中途离团，一律视为自动放弃，不退任何费用。 2、因人力不可抗拒因素（如飞机、火车延误、交通事故、自然灾害、社会因素、台风、政治等等）所产生的费用由客人 自理。各 自产生损失各自承担。 3、临时脱团：团队游览中不允许游客擅自提前离团或者脱团（自由活动除外），中途离团视为游客违约，游客需按照合同总金额的 20%赔付旅行社。由此造成未参加的行程内景点、用餐、住宿、用车等费用一律不退，旅行社亦不承担游 客离团后发生意外的责任</p>\",\"productGuidePicUrl\":\"data:image/png;base64,\",\"startDate\":1562947200000}', 566, '113.25.10.12', '2021-04-12 03:51:17.558000');
