  `children_price` decimal(8, 2) NULL DEFAULT NULL COMMENT '儿童价格',
  `single_room_price` decimal(8, 2) NULL DEFAULT NULL COMMENT '单房差',
  `product_characteristic` longtext CHARACTER SET utf8 COLLATE utf8_bin NULL COMMENT '产品特色',
