  `cost_inclusion` longtext CHARACTER SET utf8 COLLATE utf8_bin NULL COMMENT '费用包含',
  `cost_excluded` longtext CHARACTER SET utf8 COLLATE utf8_bin NULL COMMENT '费用不含',
  `reservation_notes` longtext CHARACTER SET utf8 COLLATE utf8_bin NULL COMMENT '预定须知',
  `return_rules` longtext CHARACTER SET utf8 COLLATE utf8_bin NULL COMMENT '退改规则',
  `contact_number` varchar(13) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '咨询电话',
  `supplier_id` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '供应商id',
  `supplier_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '供应商名称',
  `state` varchar(2) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '状态，0为未发布，1为发布，2为下架',
  `create_user_id` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '创建人',
  `create_date` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `modify_user_id` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '修改人',
  `modify_date` datetime(0) NULL DEFAULT NULL COMMENT '修改时间',
  `delete_state` varchar(1) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '删除状态',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_bin COMMENT = '旅游产品信息表' ROW_FORMAT = Dynamic;

